            localparam NCHK = (MAX_PA ? (A_DWID_IMPL / B_DWID_IMPL) : (B_DWID_IMPL / A_DWID_IMPL)) ; 
            localparam LRAM_ADDR = roundUP(ADDR_DEPTH_A,
                        A_DEPTH_IMPL) ; 
            localparam LRAM_DATA = roundUP(DATA_WIDTH_A,
                        A_DWID_IMPL) ; 
            if ((NCHK == Q_FACTOR)) 
                begin : genblk1
                    // ------ Port A Address Truncation ------
                    wire [(A_AWID_IMPL - 1):0] addr_a_w ; 
                    if ((A_AWID_IMPL > ADDR_WIDTH_A)) 
                        begin : _A_EXPAND
                            assign addr_a_w[(A_AWID_IMPL - 1):ADDR_WIDTH_A] = {(A_AWID_IMPL - ADDR_WIDTH_A){1'b0}} ; 
                            assign addr_a_w[(ADDR_WIDTH_A - 1):0] = addr_a_i ; 
                        end
                    else
                        begin : _A_TRUNCATE
                            assign addr_a_w = addr_a_i[(A_AWID_IMPL - 1):0] ; 
                        end
                    // ------ Port B Address Truncation ------
                    wire [(B_AWID_IMPL - 1):0] addr_b_w ; 
                    if ((B_AWID_IMPL > ADDR_WIDTH_B)) 
                        begin : _B_EXPAND
                            assign addr_b_w[(B_AWID_IMPL - 1):ADDR_WIDTH_B] = {(B_AWID_IMPL - ADDR_WIDTH_B){1'b0}} ; 
                            assign addr_b_w[(ADDR_WIDTH_B - 1):0] = addr_b_i ; 
                        end
                    else
                        begin : _B_TRUNCATE
                            assign addr_b_w = addr_b_i[(B_AWID_IMPL - 1):0] ; 
                        end
                    // ------ TOP level wiring ports ------
                    wire [(PORT_A_DWID_USE - 1):0] in_a_top_w ; 
                    wire [(PORT_B_DWID_USE - 1):0] in_b_top_w ; 
                    wire [(PORT_A_BWID_USE - 1):0] ben_a_top_w ; 
                    wire [(PORT_B_BWID_USE - 1):0] ben_b_top_w ; 
                    wire [(PORT_A_DWID_USE - 1):0] out_a_top_w ; 
                    wire [(PORT_B_DWID_USE - 1):0] out_b_top_w ; 
                    // ------ LRAM level wiring ports ------
                    wire [(PORT_A_DWID_USE - 1):0] in_a_lram_w ; 
                    wire [(PORT_B_DWID_USE - 1):0] in_b_lram_w ; 
                    wire [(PORT_A_BWID_USE - 1):0] ben_a_lram_w ; 
                    wire [(PORT_B_BWID_USE - 1):0] ben_b_lram_w ; 
                    wire [(PORT_A_DWID_USE - 1):0] out_a_lram_w ; 
                    wire [(PORT_B_DWID_USE - 1):0] out_b_lram_w ; 
                    // ------ Output Port MUX ------
                    wire [(PORT_A_DWID_USE - 1):0] out_a_lram_raw_w [(LRAM_ADDR - 1):0] ; 
                    wire [(PORT_B_DWID_USE - 1):0] out_b_lram_raw_w [(LRAM_ADDR - 1):0] ; 
                    wire [(LRAM_ADDR - 1):0] lramready_addr_w ; 
                    wire [(LRAM_ADDR - 1):0] rd_datavalid_a_addr_w ; 
                    wire [(LRAM_ADDR - 1):0] rd_datavalid_b_addr_w ; 
                    if ((PORT_A_DWID_USE > PORT_B_DWID_USE)) 
                        begin : _A_OVR_B
                            localparam DWID_FACTOR = (PORT_A_DWID_USE / PORT_B_DWID_USE) ; 
                            // ------ PORT [B] (TOP wrapper to TOP level split) Wiring : (DATA_WIDTH_A > DATA_WIDTH_B) ------
                            if ((PORT_B_DWID_USE > DATA_WIDTH_B)) 
                                begin : _B_DWID_EXPAND
                                    assign in_b_top_w[(PORT_B_DWID_USE - 1):DATA_WIDTH_B] = {(PORT_B_DWID_USE - DATA_WIDTH_B){1'b0}} ; 
                                end
                            assign in_b_top_w[(DATA_WIDTH_B - 1):0] = wr_data_b_i ; 
                            if ((BYTE_ENABLE_B || UNALIGNED_READ)) 
                                begin : genblk2
                                    if ((PORT_B_BWID_USE > BYTE_WIDTH_B)) 
                                        begin : _B_BWID_EXPAND
                                            assign ben_b_top_w[(PORT_B_BWID_USE - 1):BYTE_WIDTH_B] = {(PORT_B_BWID_USE - BYTE_WIDTH_B){1'b1}} ; 
                                        end
                                    assign ben_b_top_w[(BYTE_WIDTH_B - 1):0] = ben_b_i ; 
                                end
                            assign rd_data_b_o = out_b_top_w[(DATA_WIDTH_B - 1):0] ; 
                            // ------ PORT [A] (TOP wrapper to TOP level split) Wiring : (DATA_WIDTH_A > DATA_WIDTH_B) ------
                            for (i0 = 0;(i0 < DWID_FACTOR);i0 = (i0 + 1))
                            begin : _SEG_TOP2PORT
                                wire [(PORT_B_DWID_USE - 1):0] rd_buff_w ; 
                                if ((PORT_B_DWID_USE > DATA_WIDTH_B)) 
                                    begin : _EXP
                                        assign in_a_top_w[(i0 * PORT_B_DWID_USE) +: PORT_B_DWID_USE] = {{(PORT_B_DWID_USE - DATA_WIDTH_B){1'b0}},
                                                    wr_data_a_i[(DATA_WIDTH_B * i0) +: DATA_WIDTH_B]} ; 
                                    end
                                else
                                    begin : _CONT
                                        assign in_a_top_w[(i0 * PORT_B_DWID_USE) +: PORT_B_DWID_USE] = wr_data_a_i[(DATA_WIDTH_B * i0) +: DATA_WIDTH_B] ; 
                                    end
                                if ((BYTE_ENABLE_A || UNALIGNED_READ)) 
                                    begin : _BEN
                                        if ((PORT_B_BWID_USE > BYTE_WIDTH_B)) 
                                            begin : _EXP
                                                assign ben_a_top_w[(i0 * PORT_B_BWID_USE) +: PORT_B_BWID_USE] = {{(PORT_B_BWID_USE - BYTE_WIDTH_B){1'b1}},
                                                            ben_a_i[(BYTE_WIDTH_B * i0) +: BYTE_WIDTH_B]} ; 
                                            end
                                        else
                                            begin : _CONT
                                                assign ben_a_top_w[(i0 * PORT_B_BWID_USE) +: PORT_B_BWID_USE] = ben_a_i[(BYTE_WIDTH_B * i0) +: BYTE_WIDTH_B] ; 
                                            end
                                    end
                                assign rd_buff_w = out_a_top_w[(PORT_B_DWID_USE * i0) +: PORT_B_DWID_USE] ; 
                                assign rd_data_a_o[(DATA_WIDTH_B * i0) +: DATA_WIDTH_B] = rd_buff_w[(DATA_WIDTH_B - 1):0] ; 
                            end
                            // ------ PORT [B] (TOP level to LRAM level split) Wiring : (DATA_WIDTH_A > DATA_WIDTH_B) ------
                            assign in_b_lram_w = in_b_top_w ; 
                            assign out_b_top_w = out_b_lram_w ; 
                            assign ben_b_lram_w = ben_b_top_w ; 
                            // ------ PORT [A] (TOP level to LRAM level split) Wiring : (DATA_WIDTH_A > DATA_WIDTH_B) ------
                            wire [(B_DWID_IMPL - 1):0] in_a_lram_seg_w [((PORT_A_DWID_USE / B_DWID_IMPL) - 1):0] ; 
                            wire [(B_BWID_IMPL - 1):0] ben_a_lram_seg_w [((PORT_A_BWID_USE / B_BWID_IMPL) - 1):0] ; 
                            wire [(B_DWID_IMPL - 1):0] out_a_lram_seg_w [((PORT_A_DWID_USE / B_DWID_IMPL) - 1):0] ; 
                            // ------ Input Side (Port A) ------
                            for (i0 = 0;(i0 < LRAM_DATA);i0 = (i0 + 1))
                            begin : genblk4
                                for (i1 = 0;(i1 < (PORT_A_DWID_USE / (B_DWID_IMPL * LRAM_DATA)));i1 = (i1 + 1))
                                begin : genblk1
                                    assign in_a_lram_seg_w[(((PORT_A_DWID_USE / (B_DWID_IMPL * LRAM_DATA)) * i0) + i1)] = in_a_top_w[((i0 * B_DWID_IMPL) + ((i1 * LRAM_DATA) * B_DWID_IMPL)) +: B_DWID_IMPL] ; 
                                    if ((BYTE_ENABLE_A || UNALIGNED_READ)) 
                                        begin : genblk1
                                            assign ben_a_lram_seg_w[(((PORT_A_BWID_USE / (B_BWID_IMPL * LRAM_DATA)) * i0) + i1)] = ben_a_top_w[((i0 * B_BWID_IMPL) + ((i1 * LRAM_DATA) * B_BWID_IMPL)) +: B_BWID_IMPL] ; 
                                        end
                                end
                            end
                            for (i0 = 0;(i0 < (PORT_A_DWID_USE / B_DWID_IMPL));i0 = (i0 + 1))
                            begin : genblk5
                                assign in_a_lram_w[(i0 * B_DWID_IMPL) +: B_DWID_IMPL] = in_a_lram_seg_w[i0] ; 
                                if ((BYTE_ENABLE_A || UNALIGNED_READ)) 
                                    begin : genblk1
                                        assign ben_a_lram_w[(i0 * B_BWID_IMPL) +: B_BWID_IMPL] = ben_a_lram_seg_w[i0] ; 
                                    end
                            end
                            // ------ Output Side (Port A) ------
                            for (i0 = 0;(i0 < (PORT_A_DWID_USE / PORT_B_DWID_USE));i0 = (i0 + 1))
                            begin : genblk6
                                for (i1 = 0;(i1 < LRAM_DATA);i1 = (i1 + 1))
                                begin : genblk1
                                    assign out_a_lram_seg_w[((i0 * LRAM_DATA) + i1)] = out_a_lram_w[((i1 * A_DWID_IMPL) + (i0 * B_DWID_IMPL)) +: B_DWID_IMPL] ; 
                                end
                            end
                            for (i0 = 0;(i0 < (PORT_A_DWID_USE / B_DWID_IMPL));i0 = (i0 + 1))
                            begin : genblk7
                                assign out_a_top_w[(i0 * B_DWID_IMPL) +: B_DWID_IMPL] = out_a_lram_seg_w[i0] ; 
                            end
                        end
                    else
                        begin : B_OVR_A
                            localparam DWID_FACTOR = (PORT_B_DWID_USE / PORT_A_DWID_USE) ; 
                            // ------ PORT [A] (TOP wrapper to TOP level split) Wiring : (DATA_WIDTH_B > DATA_WIDTH_A) ------
                            if ((PORT_A_DWID_USE > DATA_WIDTH_A)) 
                                begin : _A_DWID_EXPAND
                                    assign in_a_top_w[(PORT_A_DWID_USE - 1):DATA_WIDTH_A] = {(PORT_A_DWID_USE - DATA_WIDTH_A){1'b0}} ; 
                                end
                            assign in_a_top_w[(DATA_WIDTH_A - 1):0] = wr_data_a_i ; 
                            if ((BYTE_ENABLE_A || UNALIGNED_READ)) 
                                begin : genblk2
                                    if ((PORT_A_BWID_USE > BYTE_WIDTH_A)) 
                                        begin : _A_BWID_EXPAND
                                            assign ben_a_top_w[(PORT_A_BWID_USE - 1):BYTE_WIDTH_A] = {(PORT_A_BWID_USE - BYTE_WIDTH_A){1'b1}} ; 
                                        end
                                    assign ben_a_top_w[(BYTE_WIDTH_A - 1):0] = ben_a_i ; 
                                end
                            assign rd_data_a_o = out_a_top_w[(DATA_WIDTH_A - 1):0] ; 
                            // ------ PORT [B] (TOP wrapper to TOP level split) Wiring : (DATA_WIDTH_B > DATA_WIDTH_A) ------
                            for (i0 = 0;(i0 < DWID_FACTOR);i0 = (i0 + 1))
                            begin : _SEG_TOP2PORT
                                wire [(PORT_A_DWID_USE - 1):0] rd_buff_w ; 
                                if ((PORT_A_DWID_USE > DATA_WIDTH_A)) 
                                    begin : _EXP
                                        assign in_b_top_w[(i0 * PORT_A_DWID_USE) +: PORT_A_DWID_USE] = {{(PORT_A_DWID_USE - DATA_WIDTH_A){1'b0}},
                                                    wr_data_b_i[(DATA_WIDTH_A * i0) +: DATA_WIDTH_A]} ; 
                                    end
                                else
                                    begin : _CONT
                                        assign in_b_top_w[(i0 * PORT_A_DWID_USE) +: PORT_A_DWID_USE] = wr_data_b_i[(DATA_WIDTH_A * i0) +: DATA_WIDTH_A] ; 
                                    end
                                if ((BYTE_ENABLE_B || UNALIGNED_READ)) 
                                    begin : _BEN
                                        if ((PORT_A_BWID_USE > BYTE_WIDTH_A)) 
                                            begin : _EXP
                                                assign ben_b_top_w[(i0 * PORT_A_BWID_USE) +: PORT_A_BWID_USE] = {{(PORT_A_BWID_USE - BYTE_WIDTH_A){1'b1}},
                                                            ben_b_i[(BYTE_WIDTH_A * i0) +: BYTE_WIDTH_A]} ; 
                                            end
                                        else
                                            begin : _CONT
                                                assign ben_b_top_w[(i0 * PORT_A_BWID_USE) +: PORT_A_BWID_USE] = ben_b_i[(BYTE_WIDTH_A * i0) +: BYTE_WIDTH_A] ; 
                                            end
                                    end
                                assign rd_buff_w = out_b_top_w[(PORT_A_DWID_USE * i0) +: PORT_A_DWID_USE] ; 
                                assign rd_data_b_o[(DATA_WIDTH_A * i0) +: DATA_WIDTH_A] = rd_buff_w[(DATA_WIDTH_A - 1):0] ; 
                            end
                            // ------ PORT [A] (TOP level to LRAM level split) Wiring : (DATA_WIDTH_B > DATA_WIDTH_A) ------
                            assign in_a_lram_w = in_a_top_w ; 
                            assign out_a_top_w = out_a_lram_w ; 
                            assign ben_a_lram_w = ben_a_top_w ; 
                            // ------ PORT [B] (TOP level to LRAM level split) Wiring : (DATA_WIDTH_B > DATA_WIDTH_A) ------
                            wire [(A_DWID_IMPL - 1):0] in_b_lram_seg_w [((PORT_B_DWID_USE / A_DWID_IMPL) - 1):0] ; 
                            wire [(A_BWID_IMPL - 1):0] ben_b_lram_seg_w [((PORT_B_DWID_USE / A_DWID_IMPL) - 1):0] ; 
                            wire [(A_DWID_IMPL - 1):0] out_b_lram_seg_w [((PORT_B_DWID_USE / A_DWID_IMPL) - 1):0] ; 
                            // ------ Input Side (Port B) ------
                            for (i0 = 0;(i0 < LRAM_DATA);i0 = (i0 + 1))
                            begin : genblk4
                                for (i1 = 0;(i1 < (PORT_B_DWID_USE / (A_DWID_IMPL * LRAM_DATA)));i1 = (i1 + 1))
                                begin : genblk1
                                    assign in_b_lram_seg_w[(((PORT_B_DWID_USE / (A_DWID_IMPL * LRAM_DATA)) * i0) + i1)] = in_b_top_w[((i0 * A_DWID_IMPL) + ((i1 * LRAM_DATA) * A_DWID_IMPL)) +: A_DWID_IMPL] ; 
                                    if ((BYTE_ENABLE_B || UNALIGNED_READ)) 
                                        begin : genblk1
                                            assign ben_b_lram_seg_w[(((PORT_B_DWID_USE / (A_DWID_IMPL * LRAM_DATA)) * i0) + i1)] = ben_b_top_w[((i0 * A_BWID_IMPL) + ((i1 * LRAM_DATA) * A_BWID_IMPL)) +: A_BWID_IMPL] ; 
                                        end
                                end
                            end
                            for (i0 = 0;(i0 < (PORT_B_DWID_USE / A_DWID_IMPL));i0 = (i0 + 1))
                            begin : genblk5
                                assign in_b_lram_w[(i0 * A_DWID_IMPL) +: A_DWID_IMPL] = in_b_lram_seg_w[i0] ; 
                                if ((BYTE_ENABLE_B || UNALIGNED_READ)) 
                                    begin : genblk1
                                        assign ben_b_lram_w[(i0 * A_BWID_IMPL) +: A_BWID_IMPL] = ben_b_lram_seg_w[i0] ; 
                                    end
                            end
                            // ------ Output Side (Port B) ------
                            for (i0 = 0;(i0 < (PORT_B_DWID_USE / PORT_A_DWID_USE));i0 = (i0 + 1))
                            begin : genblk6
                                for (i1 = 0;(i1 < LRAM_DATA);i1 = (i1 + 1))
                                begin : genblk1
                                    assign out_b_lram_seg_w[((i0 * LRAM_DATA) + i1)] = out_b_lram_w[((i1 * B_DWID_IMPL) + (i0 * A_DWID_IMPL)) +: A_DWID_IMPL] ; 
                                end
                            end
                            for (i0 = 0;(i0 < (PORT_B_DWID_USE / A_DWID_IMPL));i0 = (i0 + 1))
                            begin : genblk7
                                assign out_b_top_w[(i0 * A_DWID_IMPL) +: A_DWID_IMPL] = out_b_lram_seg_w[i0] ; 
                            end
                        end
                    // ------ Address Loop (Mixed Width) ------
                    for (i0 = 0;(i0 < LRAM_ADDR);i0 = (i0 + 1))
                    begin : xADDR
                        // ------ LRAM Common Signals -------
                        wire [(LRAM_DATA - 1):0] lramready_data_w ; 
                        wire [(LRAM_DATA - 1):0] rd_datavalid_a_data_w ; 
                        wire [(LRAM_DATA - 1):0] rd_datavalid_b_data_w ; 
                        if ((LRAM_DATA == 1)) 
                            begin : x_SNGL_FLAG
                                assign lramready_addr_w[i0] = lramready_data_w[0] ; 
                                assign rd_datavalid_a_addr_w[i0] = rd_datavalid_a_data_w[0] ; 
                                assign rd_datavalid_b_addr_w[i0] = rd_datavalid_b_data_w[0] ; 
                            end
                        else
                            begin : x_MULT_FLAG
                                assign lramready_addr_w[i0] = (&lramready_data_w) ; 
                                assign rd_datavalid_a_addr_w[i0] = (&rd_datavalid_a_data_w) ; 
                                assign rd_datavalid_b_addr_w[i0] = (&rd_datavalid_b_data_w) ; 
                            end
                        // ------ PORT A output ports ------
                        wire [(PORT_A_DWID_USE - 1):0] raw_out_a_w ; 
                        assign out_a_lram_raw_w[i0] = raw_out_a_w ; 
                        // ------ PORT A Address Control Signal ------
                        wire chk_addr_a_w ; 
                        if ((LRAM_ADDR > 1)) 
                            begin : genblk2
                                assign chk_addr_a_w = (addr_a_i[(ADDR_WIDTH_A - 1):A_AWID_IMPL] == i0) ; 
                            end
                        else
                            begin : genblk2
                                assign chk_addr_a_w = 1'b1 ; 
                            end
                        // ------ PORT B output ports ------
                        wire [(PORT_B_DWID_USE - 1):0] raw_out_b_w ; 
                        assign out_b_lram_raw_w[i0] = raw_out_b_w ; 
                        // ------ PORT B Address Control Signal ------
                        wire chk_addr_b_w ; 
                        if ((LRAM_ADDR > 1)) 
                            begin : genblk3
                                assign chk_addr_b_w = (addr_b_i[(ADDR_WIDTH_B - 1):B_AWID_IMPL] == i0) ; 
                            end
                        else
                            begin : genblk3
                                assign chk_addr_b_w = 1'b1 ; 
                            end
                        // ------ Data Loop (Mixed Width) ------
                        for (i1 = 0;(i1 < LRAM_DATA);i1 = (i1 + 1))
                        begin : xDATA
                            localparam ECO_POSX = (i1 * A_DWID_IMPL) ; 
                            localparam ECO_POSY = (i0 * A_DEPTH_IMPL) ; 
                            // ------ PORT A Data Wiring ------
                            wire [(A_DWID_IMPL - 1):0] in_a_w ; 
                            wire [(A_BWID_IMPL - 1):0] ben_a_w ; 
                            wire [(A_DWID_IMPL - 1):0] out_a_w ; 
                            if ((PORT_A_DWID_USE >= (A_DWID_IMPL * (i1 + 1)))) 
                                begin : _A_OUT_COMPACT
                                    assign in_a_w = in_a_lram_w[(A_DWID_IMPL * i1) +: A_DWID_IMPL] ; 
                                    assign raw_out_a_w[(A_DWID_IMPL * i1) +: A_DWID_IMPL] = out_a_w ; 
                                    if ((BYTE_ENABLE_A || UNALIGNED_READ)) 
                                        begin : genblk1
                                            assign ben_a_w = ben_a_lram_w[(A_BWID_IMPL * i1) +: A_BWID_IMPL] ; 
                                        end
                                    else
                                        begin : genblk1
                                            assign ben_a_w = {A_BWID_IMPL{1'b1}} ; 
                                        end
                                end
                            else
                                begin : _A_OUT_EXPAND
                                    assign in_a_w[(PORT_A_DWID_USE - (1 + (A_DWID_IMPL * i1))):0] = in_a_lram_w[(PORT_A_DWID_USE - 1):(A_DWID_IMPL * i1)] ; 
                                    if ((A_DWID_IMPL > (PORT_A_DWID_USE - (A_DWID_IMPL * i1)))) 
                                        begin : genblk1
                                            assign in_a_w[(A_DWID_IMPL - 1):(PORT_A_DWID_USE - (A_DWID_IMPL * i1))] = {(A_DWID_IMPL - (PORT_A_DWID_USE - (A_DWID_IMPL * i1))){1'b0}} ; 
                                        end
                                    assign raw_out_a_w[(PORT_A_DWID_USE - 1):(A_DWID_IMPL * i1)] = out_a_w[(PORT_A_DWID_USE - (1 + (A_DWID_IMPL * i1))):0] ; 
                                    if ((BYTE_ENABLE_A || UNALIGNED_READ)) 
                                        begin : genblk2
                                            if ((A_BWID_IMPL > (PORT_A_BWID_USE - (A_BWID_IMPL * i1)))) 
                                                begin : genblk1
                                                    assign ben_a_w = {(A_BWID_IMPL - (PORT_A_BWID_USE - (A_BWID_IMPL * i1))){1'b1}} ; 
                                                end
                                            assign ben_a_w[(PORT_A_BWID_USE - (1 + (i1 * A_BWID_IMPL))):0] = ben_a_lram_w[(PORT_A_BWID_USE - 1):(i1 * A_BWID_IMPL)] ; 
                                        end
                                    else
                                        begin : genblk2
                                            assign ben_a_w = {A_BWID_IMPL{1'b1}} ; 
                                        end
                                end
                            // ------ PORT B Data Wiring ------
                            wire [(B_DWID_IMPL - 1):0] in_b_w ; 
                            wire [(B_BWID_IMPL - 1):0] ben_b_w ; 
                            wire [(B_DWID_IMPL - 1):0] out_b_w ; 
                            if ((PORT_B_DWID_USE >= (B_DWID_IMPL * (i1 + 1)))) 
                                begin : _B_OUT_COMPACT
                                    assign in_b_w = in_b_lram_w[(B_DWID_IMPL * i1) +: B_DWID_IMPL] ; 
                                    assign raw_out_b_w[(B_DWID_IMPL * i1) +: B_DWID_IMPL] = out_b_w ; 
                                    if ((BYTE_ENABLE_B || UNALIGNED_READ)) 
                                        begin : genblk1
                                            assign ben_b_w = ben_b_lram_w[(B_BWID_IMPL * i1) +: B_BWID_IMPL] ; 
                                        end
                                    else
                                        begin : genblk1
                                            assign ben_b_w = {B_BWID_IMPL{1'b1}} ; 
                                        end
                                end
                            else
                                begin : _B_OUT_EXPAND
                                    assign in_b_w[(PORT_B_DWID_USE - (1 + (B_DWID_IMPL * i1))):0] = in_b_lram_w[(PORT_B_DWID_USE - 1):(B_DWID_IMPL * i1)] ; 
                                    if ((B_DWID_IMPL > (PORT_B_DWID_USE - (B_DWID_IMPL * i1)))) 
                                        begin : genblk1
                                            assign in_b_w[(B_DWID_IMPL - 1):(PORT_B_DWID_USE - (B_DWID_IMPL * i1))] = {(B_DWID_IMPL - (PORT_B_DWID_USE - (B_DWID_IMPL * i1))){1'b0}} ; 
                                        end
                                    assign raw_out_b_w[(PORT_B_DWID_USE - 1):(B_DWID_IMPL * i1)] = out_b_w[(PORT_B_DWID_USE - (1 + (B_DWID_IMPL * i1))):0] ; 
                                    if ((BYTE_ENABLE_B || UNALIGNED_READ)) 
                                        begin : genblk2
                                            if ((B_BWID_IMPL > (PORT_B_BWID_USE - (B_BWID_IMPL * i1)))) 
                                                begin : genblk1
                                                    assign ben_b_w = {(B_BWID_IMPL - (PORT_B_BWID_USE - (B_BWID_IMPL * i1))){1'b1}} ; 
                                                end
                                            assign ben_b_w[(PORT_B_BWID_USE - (1 + (i1 * B_BWID_IMPL))):0] = ben_b_lram_w[(PORT_B_BWID_USE - 1):(i1 * B_BWID_IMPL)] ; 
                                        end
                                    else
                                        begin : genblk2
                                            assign ben_b_w = {B_BWID_IMPL{1'b1}} ; 
                                        end
                                end
                            // ----------------------------------
                            // ------ SINGLE LRAM INSTANCE ------
                            // ----------------------------------
                            if ((((INIT_MODE == "none") || (INIT_MODE == "all_zero")) || (INIT_MODE == "all_one"))) 
                                begin : _NO_INIT
