                                if ((factor > 2)) 
                                    begin
                                        procData = 32 ;
                                    end
                                else
                                    begin
                                        procData = 16 ;
                                    end
                            end
                        else
                            begin
                                while ((procData < max_data))
                                    begin
                                        procData = (procData * 2) ;
                                    end
                            end
                end
            endcase 
        end
    endfunction
    function [31:0] getDatabase ; 
        input [31:0] base_count ; 
        input [31:0] idx ; 
        input [31:0] family_code ; 
        begin
            case (family_code)
            _FCODE_LIFCL_ : 
                begin
                    case (idx)
                    0 : 
                        getDatabase = 32 ;
                    1 : 
                        getDatabase = 16 ;
                    2 : 
                        getDatabase = 8 ;
                    endcase 
                end
            default : 
