                        end
                    else
                        begin
                            temp_00 = LRAM_impl(depth_impl,
                                    width_impl,
                                    16384,
                                    32) ;
                            temp_01 = LRAM_impl(depth_impl,
                                    width_impl,
                                    32768,
                                    16) ;
                            temp_02 = LRAM_impl(depth_impl,
                                    width_impl,
                                    65536,
                                    8) ;
                            if ((temp_00 <= temp_01)) 
                                begin
                                    if ((temp_00 <= temp_02)) 
                                        begin
                                            getMinimaData = 32 ;
                                        end
                                    else
                                        begin
                                            getMinimaData = 8 ;
                                        end
                                end
                            else
                                begin
                                    if ((temp_01 <= temp_02)) 
                                        begin
                                            getMinimaData = 16 ;
                                        end
                                    else
                                        begin
                                            getMinimaData = 8 ;
                                        end
                                end
                        end
                end
            default : 
                getMinimaData = 32 ;
            endcase 
        end
    endfunction
    function [31:0] clog2 ; 
        input [31:0] value ; 
        reg [31:0] num ; 
        begin
            num = (value - 1) ;
            for (clog2 = 0 ; (num > 0) ; clog2 = (clog2 + 1))
